          <!-- ğŸ§± ğŸ‡»ğŸ‡³ Hiá»ƒn thá»‹ mÃ¡y khÃ´ng pháº£i loáº¡i 40: mÃ´ phá»ng Ä‘Ã¨n thÃ¡p
              ğŸ‡¯ğŸ‡µ ã‚¿ã‚¤ãƒ—40ä»¥å¤–ã®æ©Ÿæ¢°ï¼šã‚¿ãƒ¯ãƒ¼ãƒ©ã‚¤ãƒˆã¨ã—ã¦æç”» -->
          <g *ngFor="let machine of machinesTypeNot40">
            <!-- ğŸ‡»ğŸ‡³ Khá»‘i chá»¯ nháº­t Ä‘á»©ng ná»n tráº¯ng: thÃ¢n Ä‘Ã¨n thÃ¡p
            ğŸ‡¯ğŸ‡µ ç™½ã„ç¸¦é•·ã®é•·æ–¹å½¢ï¼šã‚¿ãƒ¯ãƒ¼ãƒ©ã‚¤ãƒˆã®æœ¬ä½“ -->
            <rect
              [attr.x]="machine.x + 50"
              [attr.y]="machine.y - 30"
              width="40"
              height="80"
              fill="white"
              stroke="black"
              stroke-width="2"
              rx="15"
            />

            <!-- ğŸ‡»ğŸ‡³ Cháº¥m trÃ²n Ä‘áº¡i diá»‡n bÃ³ng Ä‘Ã¨n mÃ u theo tráº¡ng thÃ¡i
            ğŸ‡¯ğŸ‡µ çŠ¶æ…‹ã«å¿œã˜ãŸè‰²ä»˜ãã®ä¸¸ï¼šã‚¿ãƒ¯ãƒ¼ãƒ©ã‚¤ãƒˆä¸Šéƒ¨ -->
            <circle
              [attr.cx]="machine.x + 70"
              [attr.cy]="machine.y - 0"
              r="15"
              [attr.fill]="getStatusColor(machine.status)"
              stroke="black"
              stroke-width="1"
            />
          </g>

          <!-- ğŸ’¡ ğŸ‡»ğŸ‡³ Hiá»ƒn thá»‹ mÃ¡y loáº¡i 40 báº±ng hÃ¬nh elip: thá»ƒ hiá»‡n hiá»‡u suáº¥t
              ğŸ‡¯ğŸ‡µ ã‚¿ã‚¤ãƒ—40ã®æ©Ÿæ¢°ã¯æ¥•å††ã§æç”»ã—ã€ãƒ‘ãƒ•ã‚©ãƒ¼ãƒãƒ³ã‚¹ã‚’è‰²ã§è¡¨ç¾ -->
          <g *ngFor="let machine of machinesType40">
            <ellipse
              [attr.cx]="machine.x + 60"
              [attr.cy]="machine.y + 20"
              [attr.fill]="getPerformanceColor(machine.performance)"
              class="machine-ellipse"
            />
            <text
              [attr.x]="machine.x + 65"
              [attr.y]="machine.y + 35"
              class="performance-text"
              text-anchor="middle"
            >
              {{ (machine.performance ?? 0) * 100 | number:'1.1-1' }}%
            </text>
          </g>

          <!-- ğŸ§± Grid view for Edit Mode -->
          <g *ngIf="editMode">
            <ng-container *ngFor="let x of gridX">
              <line
                [attr.x1]="x"
                y1="0"
                [attr.x2]="x"
                [attr.y2]="svgHeight"
                stroke="#cccccc"
                stroke-width="1"
              />
            </ng-container>

            <ng-container *ngFor="let y of gridY">
              <line
                x1="0"
                [attr.y1]="y"
                [attr.x2]="svgWidth"
                [attr.y2]="y"
                stroke="#cccccc"
                stroke-width="1"
              />
            </ng-container>
          </g>
      </svg>
